.e. question score minus number of answers.\nE.g. an excedent of 0 means that the (net) number of votes on a question is exactly the number of answers.\nA positive excedent means more (net) upvotes than answers.\nA negative excedent means fewer (net) upvotes than answers.\n',0,621,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-05-08 23:49:10',3240,'Gilles',NULL,'2016-07-28 21:52:26'),(34772,'http://data.stackexchange.com/stackoverflow/query/34772/find-a-user-by-email-address','Find a user by email address','Looks up all accounts set to use the given email address by comparing email hashes.\r\n',1,1000,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-05-09 02:34:53',5809,'PleaseStand',NULL,'2016-07-28 21:42:57'),(34810,'http://data.stackexchange.com/stackoverflow/query/34810/top-users-by-calculated-rep','Top  users by calculated rep','Calculate a basic rep using rep rules.  Can be useful for Meta sites\r\n',1,665,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-05-09 16:41:34',5225,'Renesis',NULL,'2016-07-28 21:50:34'),(34907,'http://data.stackexchange.com/stackoverflow/query/34907/c-hard-questions','C# - Hard Questions','Tough unanswered questions relating to C#\n',1,826,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-05-10 13:22:06',5821,'normanh',NULL,'2016-07-28 21:45:42'),(34975,'http://data.stackexchange.com/stackoverflow/query/34975/nice-questions-without-nice-answers','Nice Questions without Nice Answers','All non-CW questions scored at least 10 with no non-CW answer that high.\n',1,811,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-05-11 16:01:53',5592,'mattdm',NULL,'2016-07-28 21:46:05'),(34990,'http://data.stackexchange.com/stackoverflow/query/34990/c-and-linq-hard-questions','C# and Linq - Hard Questions','Tough questions relating to C# and Linq\n',0,695,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-05-11 17:33:39',5821,'normanh',NULL,'2016-07-28 21:49:31'),(34993,