lsixfive',NULL,'2016-07-28 21:34:37'),(45152,'http://data.stackexchange.com/stackoverflow/query/45152/downvoted-answers-of-answerers-own-questions','Downvoted answers of answerers own questions','',0,653,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-08-25 20:42:31',5891,'OffBySome',NULL,'2016-07-28 21:51:04'),(45192,'http://data.stackexchange.com/stackoverflow/query/45192/how-many-more-accepted-answers-do-i-need-until-tenacious-unsung-hero','How many more accepted answers do I need until Tenacious/Unsung Hero','Variation of Eric&#39;s query &quot;How unsung am I?&quot; Zero and non-zero accepted count. Self-accepted answers do not count. How many more accepted answers with a score of zero are needed, assuming no more accepted answers with a score greater than 0, to receive both badges.\n',17,6500,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-08-26 06:12:25',6390,'PaulPRO',NULL,'2016-07-28 21:32:13'),(45195,'http://data.stackexchange.com/stackoverflow/query/45195/what-is-my-h-index','What is my h-index?','Your h-index is the highest number n, such that you have at least n questions/answers, all of which have at least n score.\n',0,706,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-08-26 06:32:51',6390,'PaulPRO',NULL,'2016-07-28 21:49:04'),(45269,'http://data.stackexchange.com/stackoverflow/query/45269/urls-of-argentinian-users-ordered-by-reputation','URLs of Argentinian users ordered by reputation','This is a query to quickly find resources (blogs, web sites) of people in a certain location (if the user entered it on the site).',1,1800,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-08-26 16:04:30',6545,'sw',NULL,'2016-07-28 21:34:50'),(45271,'http://data.stackexchange.com/stackoverflow/query/45271/myquery2asdf','myQuery2asdf','Looking for numbers and letters\n',0,731,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2011-08-26 16:23:14',6534,'jon.doe6535',NULL,'2016-07-28 21:48:02'),(45274,'htt