ram','Generates a histogram of users&#39; reputation.  The histogram bins are automatically determined using Doane&#39;s formula, and the lowest bin is discarded since it would probably contain so many users that the rest of the histogram would be unreadable. Obviously best viewed as a graph.',4,1200,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-03-23 11:34:08',12349,'200_success',NULL,'2016-07-28 21:36:32'),(178871,'http://data.stackexchange.com/stackoverflow/query/178871/my-query','My query','',2,1100,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-03-27 11:34:40',10490,'Bohemian',NULL,'2016-07-28 21:37:28'),(180108,'http://data.stackexchange.com/stackoverflow/query/180108/find-users','Find users','',0,997,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-04-01 18:05:21',13433,'DSquare',NULL,'2016-07-28 21:43:02'),(180152,'http://data.stackexchange.com/stackoverflow/query/180152/how-is-your-favourite-language-tag-doing-on-so','How is your favourite language/tag doing on SO?','Shows the trend for your favourite tag\r\n',0,822,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2010-12-13 09:58:16',13434,'eBusiness',NULL,'2016-07-28 21:45:49'),(180153,'http://data.stackexchange.com/stackoverflow/query/180153/how-is-your-favourite-language-tag-doing-on-so','How is your favourite language/tag doing on SO?','Shows the trend for your favourite tag\r\n',0,821,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2010-12-13 09:58:16',13434,'eBusiness',NULL,'2016-07-28 21:45:50'),(180154,'http://data.stackexchange.com/stackoverflow/query/180154/how-is-your-favourite-language-tag-doing-on-so','How is your favourite language/tag doing on SO?','Shows the trend for your favourite tag\r\n',0,797,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2010-12-13 09:58:16',13434,'eBusiness',NULL,'2016-07-28 21:46:28'),(180156,'http://data.stackexchange.com/stackoverflow/query/180156/how-is-your-favourite-language-tag-doing-