are larger than the imgur upload size limits (4 MB non-gif; 2 MB gif). \r\n\r\nAlso, the [Snippet] column may list an imgur URL; this is because it just lists the URL of the first image it finds. There may still be non-imgur images elsewhere in the post.',2,700,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-04-03 22:34:28',11293,'senshin',NULL,'2016-07-28 21:49:16'),(180833,'http://data.stackexchange.com/stackoverflow/query/180833/tag-love','Tag Love','Tags ranked by total upvotes vs. downvotes on open questions (mostly -- reopened questions may not count), ordered by 95% CI lower bound algorithm from http://www.evanmiller.org/how-not-to-sort-by-average-rating.html.',1,652,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-04-05 02:32:45',12370,'jon.doe12371',NULL,'2016-07-28 21:51:06'),(181756,'http://data.stackexchange.com/stackoverflow/query/181756/question-asking-badges','Question asking badges','',0,14000,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-04-08 21:17:31',7508,'Jon &quot;not doe&quot; Ericson',NULL,'2016-07-26 03:16:07'),(182188,'http://data.stackexchange.com/stackoverflow/query/182188/tag-size-and-growth-trends','Tag Size and Growth Trends','Enter a tag and a time range to see the growth in posts using that tag over time, grouped by calendar months by default. Set the mode parameter to 1 if you want to group by calendar months, but aligned to last dump day instead of calendar boundaries; or 2 to group by 30-day periods (&#39;months&#39;) aligned to last dump day.',0,664,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2012-12-29 22:55:17',11476,'michaelb958',NULL,'2016-07-28 21:50:38'),(182189,'http://data.stackexchange.com/stackoverflow/query/182189/worst-comments-per-user','Worst comments per user','',3,919,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-04-10 00:11:09',11133,'Brian Ballsun-Stanton',NULL,'2016-07-28 21:44:01'),(182739,'http://data.stackexchange.com/stackoverflow/query/182739/questions-with-no-answers','Questions with no answers','',0,664,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-04-12 23:22:13',13527,'Icy Defiance',NULL,'2016-07-28 21:50:39'),(183696,'http://data.stackexchange.com/stackoverflow/query/183696/user-retention','User Retention','This query tries to profile the activity/behaviour of new users on the site\r\n\r\n- Group the users in to monthly batches... all the users who joined in month X are grouped together.\r\n- Count the number of users in that month&#39;s intake.\r\n- Count the number of questions/answers that are asked by that month&#39;s intake for every week after they joined.\r\n- convert it to a percentage\r\n\r\nReading the graph is as follows:\r\n\r\nAny data point represents the ratio of the number of posts in that week as a proportion of the number of users in the intake month for that curve. If a value at a given point is 10, and there were 1000 users that joined in that month, then it means that those users posted 100 questions/answers (100 / 1000 expressed as a percent).\r\n',3,750,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-04-16 02:03:12',12469,'rolfl',NULL,'2016-07-28 21:47:31'),(186229,'http://data.stackexchange.com/stackoverflow/query/186229/find-tags-to-fix','Find tags to fix','',2,656,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-04-27 01:11:43',11293,'senshin',NULL,'2016-07-28 21:50:55'),(186926,'http://data.stackexchange.com/stackoverflow/query/186926/find-number-of-answers-per-month-since-2012-for-trusted-users','Find number of answers per month since 2012 for Trusted Users','',1,704,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-04-28 23:10:41',10929,'jon.doe10930',NULL,'2016-07-28 21:49:09'),(186985,'http://data.stackexchange.com/stackoverflow/query/186985/never-met-a-question-or-answer-they-didnt-like','Never Met A Question Or Answer They Didn&#39;t Like!','',3,1900,'<pre id=\"queryBodyText\" class=\"cm-s-defaul