y effective Fastest Gun in the West.',4,1500,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-06-19 18:33:44',5824,'Martijn Pieters',NULL,'2016-07-28 21:35:22'),(203302,'http://data.stackexchange.com/stackoverflow/query/203302/user-reputation-history','user reputation history','http://meta.stackexchange.com/questions/144716/reputation-history-from-data-explorer',3,798,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-06-22 13:09:00',11779,'rene',NULL,'2016-07-28 21:46:25'),(203798,'http://data.stackexchange.com/stackoverflow/query/203798/comments-contain-word','Comments contain word','Please Note: This query only searches comments left within the last week or so',4,1200,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-03-14 01:43:21',12986,'bluet',NULL,'2016-07-28 21:36:44'),(204830,'http://data.stackexchange.com/stackoverflow/query/204830/posts-with-links-to-other-posts','Posts with links to other posts','',0,619,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-06-28 16:19:46',13355,'Debasis',NULL,'2016-07-28 21:52:31'),(206049,'http://data.stackexchange.com/stackoverflow/query/206049/tt','tt','',0,639,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-07-03 14:32:19',14901,'Titanic',NULL,'2016-07-28 21:51:38'),(206201,'http://data.stackexchange.com/stackoverflow/query/206201/curious-inquisitive-socratic-badge-progress','Curious Inquisitive Socratic Badge Progress','Calculates the number of days a user has with questions that have upvotes and there are no downvoted questions and displays progress toward each of the badges',12,3900,'<pre id=\"queryBodyText\" class=\"cm-s-default\">',NULL,'2014-07-04 01:41:56',10490,'Bohemian',NULL,'2016-07-28 21:32:44'),(206619,'http://data.stackexchange.com/stackoverflow/query/206619/participation-value-ratios','Participation value ratios','Pull out the vital statistics of the key figures on your site.&lt;br&gt;\r\n2 special columns: ValueAdd and Feedback&lt;br&gt;\